import React from 'react';

interface InfoButtonProps {
  onClick: () => void;
}

const InfoButton: React.FC<InfoButtonProps> = ({ onClick }) => {
  return (
    <button
      onClick={onClick}
      className="fixed bottom-6 left-6 w-10 h-10 bg-white border border-grey-300 rounded-full shadow-sm hover:shadow-md transition-shadow duration-200 flex items-center justify-center group"
      title="More about this experiment"
    >
      <svg 
        width="16" 
        height="16" 
        viewBox="0 0 16 16" 
        fill="none"
        className="text-grey-600 group-hover:text-grey-800 transition-colors"
      >
        <circle 
          cx="8" 
          cy="8" 
          r="7" 
          stroke="currentColor" 
          strokeWidth="1.5"
        />
        <path 
          d="M8 12V8M8 4h.01" 
          stroke="currentColor" 
          strokeWidth="1.5" 
          strokeLinecap="round" 
          strokeLinejoin="round"
        />
      </svg>
    </button>
  );
};

export default InfoButton;
